import React from 'react';

import './index.css';

function Auth() {
	return (
		<div className='auth'>
			<div className='auth-title'>Sign in!</div>
			<div className='auth-id'></div>
			<div className='auth-pw'></div>
			<div className='auth-btn auth-signin'></div>
			<div className='auth-btn auth-signup'></div>
		</div>
	);
}

export default Auth;
